import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';
import 'leaflet/dist/leaflet.css';
import './App.css';
import './styles/mobile.css'; // New import statement added here
import MapPage from './components/MapPage';
import AdminPanel from './components/AdminPanel';
import Navigation from './components/Navigation';
import { GeolocationHandler } from './components/GeolocationHandler';

function App() {
  const [userLocation, setUserLocation] = useState<{ lat: number; lon: number } | null>(null);

  const handleLocationUpdate = (lat: number, lon: number) => {
    setUserLocation({ lat, lon });
  };

  return (
    <Router>
      <div className="App">
        <GeolocationHandler onLocationUpdate={handleLocationUpdate} />
        <Navigation />
        <Routes>
          <Route path="/" element={<MapPage initialUserLocation={userLocation} />} />
          <Route path="/admin" element={<AdminPanel />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
